import React from 'react';

const Error = ({ statusCode }) => {
  let message;
  let caption;

  switch (statusCode) {
    case 404:
      message = 'Not found';
      caption = 'This page could not be found';
      break;
    case 500:
      message = 'Server error';
      caption = 'Something went wrong';
      break;
    default:
      message = 'Server error';
      caption = 'Something went wrong';
  }

  return (
    <div>
      <h1>{statusCode} {message}</h1>
      <h4>{caption}</h4>
    </div>
  );
};

export default Error;
